
public class ContinueEx3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 5;
		for(int i=1;i<=a;i++) {
			System.out.println("Anurag");
			if(i>=3) {
				continue;
			}
			System.out.println("Kumar");
		}
		System.out.println("Bye");
	}

}
